import React from 'react'

const SectionTitle = props => {
  return (
    <h4 className="has-text-left has-text-link is-size-5 has-text-weight-normal mt-2rem mb-1rem">
      <strong>{props.title}</strong>
    </h4>
  )
}

export default SectionTitle
